import React from 'react';
import './AboutMe.css';

function AboutMe() {
  return (
    <section id="about">
      <h2>About Me</h2>
      <p>
        I am a passionate web developer with experience in React, JavaScript, and more...
      </p>
    </section>
  );
}

export default AboutMe;
